import './App.css';
import Login from './components/sessions/Login'
import UserHomepage from './components/user_components/UserHomepage'
import UserFavorites from './components/coffee_shops/UserFavorites';
import {useState} from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom"




function App() {

  const [loggedIn, setLoggedIn ] = useState(true)
  const [user, setUser] = useState(null)


  return (
    <BrowserRouter>
      <Routes>
        <Route path="home" element={
          <div className="App">
            {loggedIn ? 
              <UserHomepage setUser={setUser} isLoggedIn={setLoggedIn} /> 
                : 
              <Login  isLoggedIn={setLoggedIn} />
             }
          </div>
        } />
        <Route path="favorites" element={<UserFavorites/>} />
        <Route path="profile" element={"<Profile/>"} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
